import React from 'react';
import { Form, ImageInput, ImageField } from 'react-admin';
import './ImageInputForm.css'


const ImageInputForm = () => {
    return (
        <>
            <div>
                <p className='f3'>
                    Beauty Brain has one goal...Find YOUR color. Input an image of your face in good lighting, and Beauty Brain will tell you the Pantone color that best suits YOUR
                </p>
            </div>
            <div className='f4 pa2 w-70 center'>
                <Form>
                    <ImageInput source="" accept={{ 'image/*': ['.png', '.jpg'] }} multiple='false' placeholder={<p>Drop your face image here!</p>}>
                        <ImageField source="src" title="title" />
                    </ImageInput>
                </Form>
            </div>
        </>

    )
}

export default ImageInputForm;
